CBRE Hotels on behalf of Receivers and Managers Grant Thornton are delighted to offer the exclusive opportunity to purchase 150 Bundall Road & 6-8 Holden Place, Bundall, Queensland.

* Former Gold Coast Hotel, 2km* from Surfers Paradise
* Hotel licence with approval for 40 Gaming Machines
* 3,145sqm* over 3 land titles with development potential (STCA)
* Max build height 6 Storey with 40% site coverage (STCA)
* Land bank opportunity underpinned by strong UCV values
* Opportunity for hotel operators, developers & investors
* Lot 1&2 RP 153281 & Lot 1 RP 172427 - are available to be purchased in one line or separately

"The Hotel"
* Previously an iconic hotel in the local community with local patronage;
* Former hotel with public bar and bistro areas which have undergone renovations over the last three years (approximately);
* Liquor Licence and Gaming Machine Licence with approval for 40 gaming machines (operating authorities not included in the sale);
* Large function rooms on the first floor;
* Well appointed commercial kitchen with modern fit-out;
* Views from "The Hotel" overlooking the Nerang River;
* Large single bar operation including substantial well appointed bar;
* Formal restaurant with river views;
* Scope to further improve the asset with a re configuration of the existing hotel;
* Waterfront development site potential subject to council approval;
* Strong underpinned UCV land value.

"The Car Park"
* Large vacant land parcel approximately 2km from Surfers Paradise;
* Strong underpinned UCV land value;
* Street frontage to Holden Place;
* Two registered land titles;
* Development site potential subject to council approval.

"The Hotel" and "Car Park" are being offered for sale by way of Expressions of Interest ("EOI") closing 4:00pm on Thursday 4th April 2013. The properties are available to be purchased in one line or separately.

Contact the exclusive agents listed to receive a copy of the detailed Information Memorandum or to discuss further.

